import Header from './header';
import Footer from './footer';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import styles from '../screens/CSS/home.module.css';
import imageTest from '../assets/testproduct.jpg'

function ProductInformation({navigation}) {
    return (
      <div className={styles.Home}>
        <Header navigation={navigation}/>
        <div className={styles.content} >
          <div className={styles.wraper}>
            <p className={styles.tdisplay}> Product Information</p>
            <div className={styles.footerCol_1}>
              <Card sx={{ maxWidth: 345 }}>
                <CardActionArea>
                  <CardMedia
                    component="img"
                    image={imageTest}
                    alt="green iguana"
                  />
                </CardActionArea>
              </Card>
              <div className={styles.footerCol_2}>
                  <h3>Contact Us</h3>
                  <a href='/'><p>Facebook</p></a>
                  <a href='/'><p>Instagram</p></a>
                  <a href='/'><p>Youtube</p></a>
              </div>
              <div>
              <span class="fa fa-star checked"></span>
              <span class="fa fa-star checked"></span>
              <span class="fa fa-star checked"></span>
              <span class="fa fa-star"></span>
              <span class="fa fa-star"></span>
              <span class="review-no">999 reviews</span>
              </div>
          </div>
        </div>
      </div>
      <Footer navigation={navigation}/>
    </div>
    );
  }
  
  export default ProductInformation;
